	"opportunity/opportunity/view/fragments/GeneralSection.fragment.xml":'<core:FragmentDefinition\n    xmlns="sap.m"\n    xmlns:core="sap.ui.core"\n    xmlns:f="sap.ui.layout.form"\n><VBox class="sapUiSmallMargin"><f:SimpleForm\n            id="SimpleFormDisplayColumn_twoGroups234"\n            editable="false"\n            layout="ColumnLayout"\n            columnsM="2"\n            columnsL="3"\n            columnsXL="4"\n        ><f:content><core:Title text="{i18n>groupDatesLabel}" /><Label text="{i18n>opportunityCreatedQuarter}" /><Text text="{opportunityCreatedQuarter}" /><Label text="{i18n>opportunityClosedQuarter}" /><Text text="{opportunityClosedQuarter}" /><Label text="{i18n>opportunityStartDate}" /><Text\n                    text="{ path: \'opportunityStartDate\',\n\t\t\t\t\t\t\ttype: \'sap.ui.model.type.Date\',\n\t\t\t\t\t\t\tformatOptions: {\n\t\t\t\t\t\t\t\t\tstyle: \'medium\'\n\t\t\t\t\t\t}}"\n                /><Label text="{i18n>opportunityDueDate}" /><Text\n                    text="{ path: \'opportunityDueDate\',\n\t\t\t\t\t\t\ttype: \'sap.ui.model.type.Date\',\n\t\t\t\t\t\t\tformatOptions: {\n\t\t\t\t\t\t\t\t\tstyle: \'medium\'\n\t\t\t\t\t\t}}"\n                /><core:Title text="{i18n>groupValueLabel}" /><Label text="{i18n>Value}" /><Text text="{opportunityValue}k" /><Label text="{i18n>opportunityInCRM}" /><CheckBox id="opportunityInCRMObject" text="{opportunityInCRM}" selected="{= ${opportunityInCRM} === \'Yes\' ? true : false}" select="onCRMCheckboxSelect"/></f:content></f:SimpleForm></VBox></core:FragmentDefinition>\n',
